let rec fibo n=
	if n=0 then 0 else
		if n=1 then 1 else
			fibo(n-1)+fibo(n-2);;

fibo 42;;




let fibo2 n=
	let rec fiboT n pn ppn=
		if n=0 then ppn else
			fiboT (n-1) (pn+ppn) pn 
	in fiboT n 1 0;;

		
fibo2 42;;

			
					
							
											
	
									
																									
															
																				
let root a=
	let rec root3 x=
		if abs_float(x**3.-.a)<=(10.**(-15.))*.abs_float(a) then x
		else 	root3(x+.(((a/.(x**2.))-.x)/.3.))
																								
 	in root3(if a>1. then a/.3. else a);;
	
																																																																				
